column18:
The distract tactic can be seen in the following post:

@EzraFriedlander @ANCA_DC Ah here we are. I always look forward to hearing bs from Ezra Freeloader. Hey how was that dinner you had with Jake the Fake on Aliyev‚Äôs expense

This post mentions personal names and a dinner, completely irrelevant to the topic of discussing agressions from the Aliyev regime on Armenian people. This tactic aims to shift the conversation away from the main issue being discussed and focus on something unrelated.

column11:
The only post that uses an Engage tactic is the following:

@knj_brasil @KOOKSCHXSE @secawards I vote #RM for #ArtistaAsiatico at #SECAwards marcos

This post brings up a related but relevant topic by including another user in the tweet (@KOOKSCHXSE).
